import React from "react";
import './submit.css';

const EmptyPopup = ({ onClose, res }) => {
  let imageSource1,text,cause,prevention,precaution;

  if (res === "Apple___Apple_scab") {
    imageSource1 = "";
    imageSource2 = ""
  }
  else if (res === "Apple___Black_rot") {
    imageSource1 = "apple_bact_image.jpg";
  }
  else if (res === "Apple___Cedar_apple_rust") {
    imageSource1 = "orange_bact_image.jpg";
  }
  else if (res === "Apple___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Blueberry___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Cherry_(including_sour)___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Cherry_(including_sour)___Powdery_mildew") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Corn_(maize)___Cercospora_leaf_spot Gray_leaf_spot") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Corn_(maize)___Common_rust_") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Corn_(maize)___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Corn_(maize)___Northern_Leaf_Blight") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Grape___Black_rot") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Grape___Esca_(Black_Measles)") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Grape___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Grape___Leaf_blight_(Isariopsis_Leaf_Spot)") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Orange___Haunglongbing_(Citrus_greening)") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Peach___Bacterial_spot") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Pepper,_bell___Bacterial_spot") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Peach___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Pepper,_bell___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Potato___Early_blight") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Potato___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Potato___Late_blight") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Raspberry___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Soybean___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Squash___Powdery_mildew") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Strawberry___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Strawberry___Leaf_scorch") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___Bacterial_spot") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___Early_blight") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___healthy") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___Late_blight") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___Leaf_Mold") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___Septoria_leaf_spot") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___Spider_mites Two-spotted_spider_mite") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___Target_Spot") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___Tomato_mosaic_virus") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else if (res === "Tomato___Tomato_Yellow_Leaf_Curl_Virus") {
    imageSource1 = "banana_bact_image.jpg";
  }
  else {
    imageSource1 = "default_image.jpg";
  }
  
  return (
    <div className="popup-overlay popup-overla " style={{color:'white'}}>
      <div className="popup-content popup-conten">
        <div className="popup-header popup-heade">
          <h3>PREDICTION</h3>
        </div>
        <div className="popup-body popup-bod">
      <p style={{color:"red", fontSize:"x-large"}}>   {res}  <p>
           
          </p>
          <img src={imageSource1} alt="Result Image" />
          {/* <img src={imageSource2} alt="Result Image" />
          <img src={imageSource3} alt="Result Image" />
          <img src={imageSource4} alt="Result Image" />
          <img src={imageSource5} alt="Result Image" /> */}
          <h2>{text}</h2>
          <h3>{cause}</h3>
          <h3>{prevention}</h3>
          <h3>{precaution}</h3>
          </p>
        </div>
        <div className="popup-footer popup-foote ">
          <button className="btn btn-primary" onClick={onClose}>
            Cancel
          </button>
        </div>
      </div>
    </div>
  );
};

export default EmptyPopup;
